import React from "react";
import { useDispatch, useSelector } from "react-redux";
import "../../styles/Sellings/Sellings.css";

function Sellings() {
  const dispatch = useDispatch();
  const { sellingsProducts } = useSelector((state) => state.products);
  const handleClassNameActive = (e) => {
    const listItems = Array.from(e.target.parentElement.children);
    listItems.forEach((item) => {
      item.classList.remove("active");
      e.target.classList.add("active");
    });
  };
  return (
    <div className="sellings">
      <div className="container p-0">
        <div className="products-settings">
          <h3>Top Selling</h3>
          <ul>
            <li className="active">All</li>
            <li>Smartphones</li>
            <li>Watches</li>
            <li>Headphones</li>
            <li>Laptops</li>
            <li>Cameras</li>
          </ul>
        </div>
        <div className="sellings-content"></div>
      </div>
    </div>
  );
}

export default Sellings;
